import Link from "next/link";

const Index = () => (
  <div>
    <ul>
      <li>
        <Link href="/"></Link>
      </li>
    </ul>
    <h1>Homepage</h1>
    <p>Application to view available books and related data</p>
  </div>
);

export default Index;
